    title: Informations
    short_description: 'Lorem ipsum dolor sit amet.  Praesent et mi non orci vehicula eleifend at in dolor'
    content: "<ul>\r\n<li>\r\n<h2><strong>horaires</strong></h2>\r\n</li>\r\n</ul>\r\n<p class=\"Style20\">-&nbsp;<span class=\"style3\">Entra&icirc;nement jeunes</span></p>\r\n<p class=\"Style20\" style=\"padding-left: 30px;\"><span class=\"style3\">Niveau 1 (en fonction &acirc;ge/niveau sera d&eacute;termin&eacute; entre l&rsquo;inscription et les tous premiers cours)&nbsp;<strong>Mercredi 17h45 - 18h45</strong></span></p>\r\n<p class=\"Style20\" style=\"padding-left: 30px;\"><span class=\"style3\">Niveau 2&nbsp;<strong>Mercredi 18h45 - 19h45</strong></span></p>\r\n<p class=\"Style22\">- Entra&icirc;nement adultes&nbsp;<strong>Mercredi 19h30- 21h30</strong></p>\r\n<p class=\"Style22\">- Entrainement libre&nbsp;<strong>Dimanche 10h15-12h30</strong>&nbsp;et&nbsp;<strong>Mercredi 20h00- 22h00</strong></p>\r\n<p class=\"Style22\">&nbsp;</p>\r\n<ul>\r\n<li class=\"style10\">\r\n<h2><strong>tarifs</strong></h2>\r\n</li>\r\n</ul>\r\n<p class=\"style3\">- Cotisation annuelle adultes et juniors&nbsp;<span class=\"style6\">115 Euros</span></p>\r\n<p class=\"style3\">- Cotisation annuelle jeunes&nbsp;jusqu&rsquo;&agrave;&nbsp;cadets 2&egrave;me&nbsp;ann&eacute;e (31/12/99)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"style6\">100 Euros</span></p>\r\n<p><strong>inscriptions aux comp&eacute;titions individuelles&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</strong></p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Poussins &ndash; Benjamins &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;20 euros</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Minimes Cadets Juniors &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;31 euros</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Adultes &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 38 euros</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Maillot pour la comp&eacute;tition&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10&nbsp; euros de participation</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li class=\"style10\">\r\n<h2><strong class=\"style16\">Competitions<br /></strong></h2>\r\n</li>\r\n</ul>\r\n<p>Cette saison notre club alignera :</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Cinq &eacute;quipes en championnat de FRANCE </strong>:<span class=\"Style18\">&nbsp;<strong>de d&eacute;partementale 3 &agrave; r&eacute;gionale&nbsp;</strong></span>3</li>\r\n<li><strong>Trois &eacute;quipes en championnat de Paris </strong>&nbsp;:&nbsp;<span class=\"Style24\">de la division 2 &agrave; la division promotion honneur</span></li>\r\n<li><strong>Des &eacute;quipes en coupe du Val d'Oise.</strong></li>\r\n<li><strong>Des &eacute;quipes en championnat de jeunes.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>"
